//SPDX-License-Identifier: MIT

/* RELEASE NOTES:
    This contract is is only to be used for the initial Metanoia Settler's NFT mint
     - it is a cheaper and simpler alternative to using Chainlink. This is fine 
     for the initial Metanoia Settler's NFT mint since that contract is a
     one-time use contract.   

    This contract is a data-only file.
*/

pragma solidity 0.8.1;

contract FoundingSettlersList {

    struct AddressList {
        uint length;
        mapping(uint => address) list;
    }
    AddressList public addresses;

    function _addAddress(address _address) internal {
        addresses.list[addresses.length] = _address;
        addresses.length++;
    }

    function _initList() internal {
        addresses.length = 0;
        _addAddress(0xc0ffee254729296a45a3885639AC7E10F9d54979);
        _addAddress(0x59eeD72447F2B0418b0fe44C0FCdf15AAFfa1f77);
    }

    
    
    // This variable will be populated using a script that converts a list into the
    // proper format

    // Format:
    // addresses[/*INSERT ADDRESS 1 HERE*/] = 1;
    // addresses[/*INSERT ADDRESS 2 HERE*/] = 1;
    // ...
    // addresses[/*INSERT ADDRESS ... HERE*/] = 1;
}

